import './App.css';
import Card from './components/Card';
import ReviewForm from './components/ReviewForm';


function App() {
  const apiKey = '579b464db66ec23bdd000001cdd3946e44ce4aad7209ff7b23ac571b';
  return (
    <div className="container">
      <Card apiKey={apiKey} />
      <ReviewForm />
    </div>
  );
}

export default App;
